/**
* Version 0.19
* modal element template
**/

(function ($) {
	window.dekkoModule = function (object) {

		if (typeof $.easing.def === 'undefined')
			object.item.effects = ['swing', 'swing'];

		var css = {
			overlay: {
				'display' 				: 'none',
			    'position' 				: 'fixed',
			    'z-index' 				: '1000',
			    'top' 					: '0',
			    'left' 					: '0',
			    'overflow' 				: 'hidden',
			    'width' 				: '100%',
			    'height' 				: '100%',
			    'background' 			: 'rgba(0, 0, 0, .6)'
			},
			row: {
			    'display'				: 'table',
			    'width' 				: '100%',
			    'height' 				: '100%'
			},
			row_col: {
			    'display' 				: 'table-cell',
			    'padding' 				: '0 10px',
			    'vertical-align' 		: 'middle'
			},
			wrap: {
				// 'display' 				: 'none',
				'max-width' 			: '701px',
				'max-height' 			: '543px',
				'background-color' 		: "#009fe4",
				'border-radius' 		: '15px',
				'margin' 				: '0px auto',
				'position' 				: 'relative',
				'-webkit-box-shadow'	: '0px 0px 10px rgba(50, 50, 50, 0.6)',
				'-moz-box-shadow' 		: '0px 0px 10px rgba(50, 50, 50, 0.6)',
				'box-shadow' 			: '0px 0px 10px rgba(50, 50, 50, 0.6)'
			},
			item: {
				'width' 				: '100%',
				'border'				: '1px solid transparent',
				'height' 				: '100%',
				'color' 				: '#fff'

			},
			link: {
				'margin' 				: '30px auto 30px auto',
				'width' 				: '314px',
				'height' 				: '57px',
				'text-decoration'		: 'none',
				'cursor'				: 'pointer',
				'background' 			: "url('data:image/png;base64,') no-repeat left top",
				'display'				: 'block'
			},
			link_hover: {
				'text-decoration'		: 'none',
				'background' 			: "url('data:image/png;base64,') no-repeat left top",
				'display'				: 'block'
			},
			content: {
				'margin' 				: '60px auto 0px auto',
				'width' 				: '523px',
				'height' 				: '298px',
				// 'border'				: '1px solid red',
				'background' 			: "url('data:image/png;base64,') no-repeat 0px 0px"
			},
			close: {
				normal: {
					// 'display' 			: 'none',
					'background' 		: "url('data:image/png;base64,') no-repeat left top",
					'width' 			: '93px',
					'height' 			: '93px',
					'position' 			: 'absolute',
					'padding' 			: '0px',
					'top' 				: '-32px',
					'right' 			: '-32px',
					'cursor' 			: 'pointer',
					'color'				: '#fff',
					'z-index' 			: '1px'
				},
				hover: {
					'color'				: '#000',
					'border'			: '1px solid #000'
				}
			}
		},
		t = {};

		t.leave = true;

		t.renderModalOnLeave = function() {
			// t.append 		= this.shadowCreate(object.append);
			t.overlay 		= $('<div/>', {  'id': object.name + '-wrap', 'css': css.overlay });
			t.row 			= $('<div/>', {  'id': object.name + '-row', 'css': css.row });
			t.row_col 		= $('<div/>', {  'id': object.name + '-row_col', 'css': css.row_col });
			t.wrap 			= $('<div/>', {  'id': object.name + '-wrap', 'css': css.wrap });
			t.item 			= $('<div/>', {  'id': object.name + '-item', 'css': css.item });
			t.content 		= $('<div/>', {  'id': object.name + '-content', 'css': css.content });
			t.link 			= $('<a/>'  , {  'id': object.name + '-link', 'target': '_blank', 'href': object.item.url, 'css': css.link });
			t.close 		= $('<div/>', {  'id': object.name + '-close', 'css': css.close.normal });
			
			t.overlay.appendTo(object.append);
			t.row.appendTo(t.overlay);
			t.row_col.appendTo(t.row);
			t.wrap.appendTo(t.row_col);
			t.item.appendTo(t.wrap);
			t.content.appendTo(t.item);
			t.link.appendTo(t.item);
			t.close.appendTo(t.wrap);

			t.link.hover(function() {
				$(this).css(css.link_hover);
			}, function() {
				$(this).css(css.link);
			});

			t.close.on('auxclick touchstart click', function() {
				t.overlay.fadeOut((object.item.effects.duration/2), object.item.effects.easing[1], function() {
					window.dekkoJS.setStore(object.closePoint, [true, object.date.now()]);
					t.overlay.remove();
				});
			});
			
			t.link.on('auxclick touchstart click', function() {
				return window.dekkoJS.clickAdvert(object);
			});

			t.overlay.delay(object.item.delay)
				.fadeIn(object.item.effects.duration, object.item.effects.easing[0], function() {
					$(this).stop(true);
			});
		};

		try {
			
			$(window).mouseleave(function() {
				if (t.leave) {
					t.leave = false;
					return t.renderModalOnLeave();
				}
			});

		} catch (e) {
			return this.exceptionsMessage({
				message: object.name + ' ' + e,
				status: this.console.dekkothrowError,
				date: new Date().toISOString()
			});
		} finally {
			return this.notice(object);
		}
	};
}(jQuery));